wp.customize.controlConstructor["oceanwp-sortable"]=wp.customize.Control.extend({ready:function(){"use strict";var i=this;i.sortableContainer=i.container.find("ul.sortable").first(),i.sortableContainer.sortable({stop:function(){i.updateValue()}}).disableSelection().find("li").each(function(){jQuery(this).click(function(){var i=jQuery(this).find("i.visibility");i.toggleClass("dashicons-saved"),i.toggleClass("dashicons-no-alt"),i.toggleClass("dashicons-visibility-faint").parents("li:eq(0)").toggleClass("invisible")})}).click(function(){i.updateValue()})},updateValue:function(){"use strict";var i=[];this.sortableContainer.find("li").each(function(){jQuery(this).is(".invisible")||i.push(jQuery(this).data("value"))}),this.setting.set(i)}});